function [fitresult, gof] = createFit(U, h1)
%CREATEFIT(U,H1)
%  Create a fit.
%
%  Data for 'H1 graph' fit:
%      X Input: U
%      Y Output: h1
%  Output:
%      fitresult : a fit object representing the fit.
%      gof : structure with goodness-of fit info.
%
%  See also FIT, CFIT, SFIT.

%  Auto-generated by MATLAB on 30-Nov-2023 15:05:48


%% Fit: 'H1 graph'.
[xData, yData] = prepareCurveData( U, h1 );

% Set up fittype and options.
ft = fittype( 'log' );

% Fit model to data.
[fitresult, gof] = fit( xData, yData, ft );

% Plot fit with data.
